nextMap.addEventListener('click', () => {
    // nxt++;
    // console.log('nextMap is called', nxt);
    nextMap.style.display = 'none';
    
    nextCnt++;
    if(nextCnt==parseFloat(rounds)+1){
        socket.emit('round-over', roomId);        
    }else{
        
        if(mode=="world"){
            genRandWorld();
        }else if(mode=="famous"){
            genRandFamous();
        }
        else if(mode=="northamerica"){
            genRandNA();
        }
        else if(mode=="southamerica"){
            genRandSA();
        }
        else if(mode=="middleeast"){
            genRandMid();
        }
        else if(mode=="europe"){
            genRandEur();
        }
        else if(mode=="asia"){
            genRandAsia();
        }
        else if(mode=="australia"){
            genRandAus();
        }
        else if(mode=="africa"){
            genRandAfr();
        }
    }
})

